def find_circle_order(n, arcs):
    cnt = [0] / (n + 1)
    edge = [set() for _ in range(n + 1)]
    for (s, t) in arcs:
        edge[s].add(t)
        edge[t].add(s)
        cnt[s] += 1
        cnt[t] += 1
    c4 = sum((1 for i in range(1, n + 1) if cnt[i] == 4))
    if c4 != n:
        return -1
    for v2 in edge[1]:
        for v3 in edge[1]:
            if v2 in edge[v3]:
                mark = [True] * (n + 1)
                mark[1] = False
                mark[v2] = False
                res = [1, v2]
                i = v3
                try:
                    while True:
                        res.append(i)
                        mark[i] = False
                        if len(res) == n:
                            return res
                        for e in edge[i]:
                            if e != i and mark[e] and (res[-2] in edge[e]):
                                i = e
                                break
                        if not mark[i]:
                            raise StopIteration
                except StopIteration:
                    pass
    return -1

